import React from 'react';
import Box from '@mui/material/Box';


function Item(props) {
  const { sx, ...other } = props;
  return (
      <Box
          sx={{
              display: 'flex',
              p: 1,
              m: 1,
              // bgcolor: '#101010',
              // color: 'grey.300',
              // border: '1px solid',
              // borderColor: 'grey.800',
              // borderRadius: 2,
              // fontSize: '0.875rem',
              // fontWeight: '700',
              // ...sx,
          }}
      />
  );
}


const CardComponent = () => {
  return (
    <div style={{ width: '100%' }}>
            <Box
                sx={{
                    display: 'flex',
                    justifyContent: 'flex-start',
                    p: 1,
                    m: 1,
                    borderRadius: 1,
                }}
            >
                <Item>Item 1</Item>
                <Item>Item 2</Item>
                <Item>Item 3</Item>
            </Box>
            <Box
                sx={{
                    display: 'flex',
                    justifyContent: 'flex-start',
                    p: 1,
                    m: 1,
                    bgcolor: 'background.paper',
                    borderRadius: 1,
                }}
            >
                <Item>Item 1</Item>
                <Item>Item 2</Item>
                <Item>Item 3</Item>
            </Box>
            <Box
                sx={{
                    display: 'flex',
                    justifyContent: 'flex-start',
                    p: 1,
                    m: 1,
                    bgcolor: 'background.paper',
                    borderRadius: 1,
                }}
            >
                <Item>Item 1</Item>
                <Item>Item 2</Item>
                <Item>Item 3</Item>
            </Box>
</div>
  )}

  export default CardComponent;
